  \"Preliminary Project Investigation Proposed Expansion of St. Vincent National Wildlife
  Refuge\",\n\t\"tracking_summary\": {\n\t\t\"total\": 10,\n\t\t\"recent\": 0\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2016-07-27T22:20:41.581534\",\n\t\"name\":
  \"preliminary-project-investigation-proposed-expansion-of-st-vincent-national-wildlife-refug\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The U. S. Fish and Wildlife Service (Service)
  proposes to protect and manage additional habitat at the St. Vincent National Wildlife
  Refuge (NWR) in the northeast gulf coast of Florida. The purpose of the proposed
  expansion is to protect adjacent mainland habitats; protect the watersheds of St.
  Vincent Sound, Apalachicola Bay, the Apalachicola and Jackson Rivers; and close
  a gap between existing public lands west of the Apalachicola River. This would create
  \ connectivity between large blocks of conservation lands in the Apalachicola Bay
  area. This proposal supports the goals of the recovery plans for the above mentioned
  federally listed threatened and endangered species, the North American, Waterfowl,
  Shorebird and Colonial Waterbird Management Plans, Partners in Flight Plan, and
  the Northeast Gulf Ecosystem Team (NEGET). The primary objectives will be to protect
  and enhance natural habitats and initiate restoration of slash pine plantations
  to pine wiregrass habitat associations. Acquisition and management of the proposed
  expansion areas would protect water quality and buffer productive coastal waters
  from the impacts of development. Existing listed species and species of management
  concern would be assured of protection. Acquisition would close a gap between existing
  conservation lands and assure connectivity of these areas for all species. The acquisition
  would also offer excellent public use opportunities such as hunting, fishing, wildlife
  observation and photography, and environmental education and interpretation\",\n\t\"license_title\":
